import React from 'react';
import Todoelement from './todoelement'
import { Context } from '../App2';


export default ({arr, deletefunction, donefunction}) => {
    return (
        <Context.Consumer>
        <ul className='list'>
            {
                arr.map(t => <li key={t.id} className='element'>
                    <Todoelement
                        id={t.id}
                        text={t.text}
                        done={t.done}
                        deletefunction={deletefunction}
                        donefunction={donefunction}
                    />
                </li>
                )
            }
        </ul>
        </Context.Consumer>
    );
}
